import React, { Component } from 'react';


export const Temporadas=({temporadas})=>{
    const numbers = [1, 2, 3, 4, 5];

    const listItems = numbers.map((number) =>
        <div className='container-11'>
            <p className='text1'>{temporadas}</p>
        </div>
     );

    return(
       <div> 
        {listItems}
       </div>
    )
}


